import axios from 'axios'
import React,{useState,useEffect} from 'react'


function PostData() {
    const [mydata,setMydata]=useState({'userId':'','title':'','body':''})

    changeHandler=e=>{
        setMydata([e.target.name],e.target.value)
    }
    handleSubmit=(e)=>{
        e.preventDefault()
        console.log(mydata)
    }

    return (
      <div>
          <form onSubmit={handleSubmit}>
              <div>
              <input type='text' name='userId' value={mydata.userId} onChange={changeHandler} />
              </div>
              <div>
              <input type='text' name='userId' value={mydata.title} onChange={changeHandler} />
              </div>
              <div>
              <input type='text' name='userId' value={mydata.body} onChange={changeHandler} />
              </div>
              
              <button type='submit'>PostData</button>
              
          </form>
          
      </div>
    );
  }
  
  export default PostData;
